import React from "react";

function Form(props) {
    return(
        <form>
            <h2 className="label-wrapper">
                <label htmlFor="new-task" >What needs to be done?</label>
            </h2>
            <input type="text" id="new-task" className="input_lg" name="new-task" autoComplete="off">
            </input>
            <button type="submit" className="btn btn_lg add">
            Add
            </button>
        </form>
    )
}

export default Form;
